import React from 'react';
import './List.css';
import Card from '../card/Card';

function List({ books }) {

  return (
    <div className='list'>
        {books.data?.map((books, index)=>{
            const {author,country,imageLink,language, link, pages ,title, year} = books;
            return (
            <Card 
                key={ index }
                author = { author }
                country = { country }
                imageLink = { imageLink }
                language = { language }
                link = { link }
                pages = { pages }
                title = { title }
                year = { year }
                />
                )
            })
            }


    </div>
  )
}

export default List
